import React, { Component } from "react";
import ReactDOM from "react-dom";
import { render } from "@testing-library/react";
import "../App.css";

export class ViewList extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className={this.props.className}>
        <p>Hellas</p>
      </div>
    );
  }
}
export default ViewList;
